    "id": 20,
    "name": "Albino Blue Topaz Guppy PAIR",
    "slug": "albino-blue-topaz-guppy-sold-as-a-pair-male-and-female",
    "category": "livestock",
    "price": 89,
    "stock": 15,
    "images": [
      "https://cdn.shopify.com/s/files/1/0587/7422/5058/products/71122BA7-DBE3-4B54-B4BA-65232756F18D_1024x1024_2x_fa31b968-95cb-4e7f-95c6-1957f6ee4c47.webp?v=1650927924"
    ],
    "description": "<meta charset=\"utf-8\">\n<div class=\"quick_stat_entry\" data-mce-fragment=\"1\"><span class=\"quick_stat_label\" data-mce-fragment=\"1\">The Albino Blue Topaz Guppy is one of many unique varieties of Poecilia reticulata guppy developed through years of careful, selective breeding. Though guppies are typically known for their vibrant coloration, the male Albino Blue Topaz features an exciting blue-orange coloration on the face, dorsal fin, and tail fin. This fresh, exciting coloration makes the Albino Blue Topaz stand out and is relished by guppy enthusiasts and any freshwater aquarium hobbyist interested in unusual and distinct fish.</span></div>\n<div class=\"quick_stat_entry\" data-mce-fragment=\"1\">\n<p data-mce-fragment=\"1\">The guppy (<em data-mce-fragment=\"1\">poecilia reticulata) </em>is one of the most beautiful and easy to keep fish of all times.</p>\n<p data-mce-fragment=\"1\">A great tropical fish for freshwater aquarium fish beginners, the Guppy is a very hardy tropical fish that is also a very prolific breeder. The male guppy is easy to distinguish from the female guppy because the male is usually more colorful with extremely colorful and large caudal fins (tails). The female is usually larger, thicker bodied, with less color and a smaller cuadal fin (tail).</p>\n<p data-mce-fragment=\"1\">They are livebearers which means that the babies are free swimming at birth. At each birth, the female can have anywhere between 4 and 60 or more babies. If left in a community tank, the guppy fry will be quickly eaten if not secured in a breeding net or breeder's box. Sadly, even the guppy parents will partake in the baby guppy feast.</p>\n<p data-mce-fragment=\"1\">Please be responsible and have a plan for what to do with the guppy fry. If you're not interested in breeding them they should do just fine when kept as all males or all females. Mix the sexes and you will most likely have babies. If knowing that the larger fish in the tank are having a feast (as they would in the wild) on the baby guppies bothers you then only keep all males or all females. You may sometimes see some aggression amongst the males but nothing too out of hand.</p>\n<p data-mce-fragment=\"1\">Also, keep in mind that female guppies can be pregnant when you buy them from the store. Look for the gravid spot by the anal vent or a bulging in the belly area.</p>\n<p data-mce-fragment=\"1\">The Albino Blue Topaz requires an aquarium of at least 10 gallons in size. It is a very peaceful fish and should be housed with tankmates of similar temperament. Though the Albino Blue Topaz is a hardy fish tolerant of small changes in water parameters, care should be taken to keep water temperature, pH, and nutrient levels in check. This hardy and energetic fish makes an excellent fish for beginning hobbyists.</p>\n<p data-mce-fragment=\"1\">Guppies are relatively easy to breed even for the beginning aquarists. If you are interested in breeding guppies, the ideal aquarium should have a covering of floating plants and a breeding box to protect the fry. Adults may eat the fry if left to fend for themselves without the breeding box. The fry should be fed brine shrimp, micro food, and pulverized flakes.</p>\n<p data-mce-fragment=\"1\">The Albino Blue Topaz is an omnivore and requires both algae-based foods as well as meaty foods. An algae-based flake food, along with freeze-dried bloodworms, tubifex, and brine shrimp will provide guppies with the proper nutrition.</p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Food</strong></span></p>\n<p data-mce-fragment=\"1\">They will accept most fish food including vitamin enriched flakes, frozen, freeze-dried, and live foods. Try to give them a variety of foods for optimum health and coloration. Feeding them live or frozen foods every once in a while should do wonders for their activity levels and general well being.</p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Care Guide</strong></span></p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Scientific Name:</span> Poecilia reticulata</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Common Names:</span> <em data-mce-fragment=\"1\">Guppy, Fancy Tail Guppy, Millions Fish, Rainbow Fish</em></p>\n<p data-mce-fragment=\"1\">Color: Blue, Orange</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Guppy Care Level:</span> Easy, good for freshwater beginners when you have only one sex. This fish will breed easily in your tank if you plan on keeping males and females in the same tank.</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Size:</span> 2 inches (5 cm)</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">pH:</span> 7 - 8</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Temperature :</span> 66°F - 84°F (19°C - 29°C)</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Water Hardness:</span> 10° to 20° dH,</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Guppy Lifespan :</span> 1-2 years</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Origin / Habitat:</span> Central America</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Guppy Temperament / Behavior:</span> This is a peaceful and hardy fish that is good for beginners.</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Tank Size:</span> 10 gallons or larger.</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Guppy Compatible Tank Mates:</span> Many, given their peaceful nature.</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Diet / Fish Food:</span> Give your Guppy flakes, freeze-dried and live foods. Vary their diet for optimum colors and health.</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Tank Region:</span> Middle to top</p>\n<p data-mce-fragment=\"1\"><span class=\"b\" data-mce-fragment=\"1\">Gender:</span> Easy to determine. The male will have the larger, more colorful tails.</p>\n</div>",
