    "description": "<p data-mce-fragment=\"1\">Common Name: Monte Carlo</p>\n<p data-mce-fragment=\"1\">Portion: 5x5cm</p>\n<p data-mce-fragment=\"1\">Micranthemum</p>\n<p data-mce-fragment=\"1\">Micranthemum ‘Monte Carlo” is a low growing aquatic plant that originates from New Zealand.  It is a perfect foreground plant that if given sufficient lighting and nutrients can grow into a thick carpet of green foliage.  The leaves are small and round with a beautiful bright green colouration that can nicely offset any neutral-toned substrate.  This plant is very similar to Hemianthus callitrichoides (HC/Dwarf Baby Tears) but the leaves are larger and in our experience, it's easier to grow.  When hobbyist are having trouble growing HC, we recommend giving Monte Carlo a try.</p>\n<p data-mce-fragment=\"1\">High lighting and Co2 injection are necessary to keep this plant low growing.  Vertical growing thin stalks are an indication of lack of lighting while yellowing leaves can mean nutrition deficiency.  Thin leaves can also hint at a lack of Co2.  This plant can grow quickly and require regular trimming when kept under proper conditions. </p>\n<p data-mce-fragment=\"1\">This plant can grow submerged or emersed in dry start aquariums and Wabi Kusa.  Because this plant is small with tiny roots, it can prove difficult to keep planted into the substrate.  In this case, a dry start can help by allowing time for the roots to anchor into the substrate before flooding the tank.</p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"><img src=\"https://tropica.com/imagegen.ashx?width=300&amp;image=/Plants/025%20TC/1.JPG&amp;crop=resize&amp;class=product\" data-mce-fragment=\"1\" data-mce-src=\"https://tropica.com/imagegen.ashx?width=300&amp;image=/Plants/025%20TC/1.JPG&amp;crop=resize&amp;class=product\"></span></p>",
