    "description": "<p><i data-mce-fragment=\"1\">Proserpinaca palustris</i>, also known as mermaid weed, can be found growing throughout the southeastern United States and Latin America in humid soils, ditches, ponds, streams, and marshes. <br data-mce-fragment=\"1\"> <br data-mce-fragment=\"1\"> <i data-mce-fragment=\"1\">P. palustris</i> grows at a moderate to slow pace, producing very few side shoots along the length of the vertical stem. When pruning is necessary, replant the upper portions and discard the bottom portions. For propagation, the plant can be encouraged to produce side shoots by cutting off upper portions and leaving the rooted, bottom portions in place. These stumps will produce one or more side shoots in a couple of days. Once they are several inches long, they can be removed and replanted in the substrate to create new plants.<br data-mce-fragment=\"1\"> <br data-mce-fragment=\"1\"> This red and orange hued species is an excellent choice for the smaller aquascape because of its small size and moderate growth rate. It is best used as a red accent in the midground to background, standing out effectively due to its bright color and unique leaf texture.</p>\n<p><strong>Portion: </strong>2 stems Submersed, around 15cm each stem. <br> <b>Light Needs:</b> Medium<br> <b>Plant Structure:</b> Stem<br> <b>Family:</b> Haloragaceae<br> <b>Genus:</b> Proserpinaca<br> <b>Region:</b> Americas<br> <b>Location:</b> Americas<br> <b>Size:</b> Stem width: 3-5cm (1-2 in)<br> <b>Growth Rate:</b> Medium<br> <b>Can Be Grown Emersed:</b> Yes</p>",
