    "description": "<p>Rotala rotundifolia is a popular aquarium plant of the rotala genus and loosestrife family, which it shares with other well known aquatic plants. Its Latin name ‘Rotundifolia’ literally means ’round leaves’. Rotundifolia is commonly mistaken for Rotala indica, another popular aquatic plant. It is also known as:<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Rotala Rotundifolia is a stem plant that thrives in wet, marshy, and aquatic environments and is a staple of aquaculture projects. The wild variety is found semi-immersed as a vigorous growing weed of rice paddies across southern Asia including China and Taiwan and can even be found in southern Europe. Use in aquascaping has led to it being introduced in the US, wherein in some regions, it has an invasive character.<br data-mce-fragment=\"1\"></p>\n<ul>\n<li>\n<strong>Common Name:</strong> Rotála rotundifólia</li>\n<li>\n<strong>Portion:</strong> 6-8 stems, around 10-15cm each stems</li>\n<li>\n<strong>Other Names:</strong> The dwarf rotala, Round-leaf tooth cup, Pink sprites</li>\n<li>\n<strong>Scientific Name:</strong> Rotála rotundifólia</li>\n<li>\n<strong>Difficulty: </strong> Easy to Medium</li>\n<li>\n<strong>Lighting:</strong> Medium to High</li>\n<li>\n<strong>Optimal pH:</strong> 6.0 – 8.0</li>\n<li>\n<strong>Optimal GH:</strong> 2 – 12 (1 – 30)</li>\n<li>\n<strong>Optimal Temperature:</strong> 20 – 28 C (68 – 82 F)</li>\n<li>\n<strong>Substrate:</strong> Needed</li>\n<li>\n<strong>Growth Form:</strong> Stem</li>\n<li>\n<strong>Growth Rate:</strong> Moderate to fast</li>\n<li>\n<strong>Placement:</strong> in Tank</li>\n<li>\n<strong>Height:</strong> up 5 – 30+ cm (2 – 12+ inches)<br>\n</li>\n<li>\n<strong>Fertilizers:</strong> Not needed to low</li>\n<li>\n<strong>CO2:</strong> Not needed to low</li>\n<li>\n<strong>Propagation:</strong> Head Cuttings or Runners</li>\n</ul>",
