    "description": "<p data-mce-fragment=\"1\">Common Name: Crypt Flamingo, <span data-mce-fragment=\"1\">Crypt Pink Panther</span><br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\"></p>\n<p data-mce-fragment=\"1\">Crypt Flamingo is one of our favorites here at the ASD' Rare Plant Farm.  The ruffled leaves and pink coloration really sets this plant apart from the other more common Crypts. This is extremely rare and sought after plant from collectors.  The exotic pink colors make it desirable compared to the common green or brown colored Cryptocoryne species. New leaves tend to have a blood red color initially which naturally lighten up into a pinkish tint over time.</p>\n<p data-mce-fragment=\"1\">It is generally a pretty easy plant to keep once it gets established in an aquarium. When grown under optimum conditions with high light and CO2, this plant can develop an intense pink coloration.  </p>\n<div data-mce-fragment=\"1\">\n<div data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Notes:</strong></div>\n</div>\n<div data-mce-fragment=\"1\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Cryptocoryne prefer not to be moved once planted. If possible, do not move them!</li>\n<li data-mce-fragment=\"1\">Do not make drastic changes to the aquarium. Unstable parameters will result in melt and rotting of the aquarium plant.</li>\n<li data-mce-fragment=\"1\">Please be sure to remove this plant from its pot. Remove the cotton surrounding the roots and plant into a quality substrate. For instructions on how to properly plant \"potted\" aquarium plants.</li>\n<li data-mce-fragment=\"1\">CO2 injection and quality aquarium soil will yield better growth.</li>\n<li data-mce-fragment=\"1\">Please research appropriately to ensure your plant thrives.</li>\n</ul>\n<p>Portion: 1 plant with around 3-4 leaves</p>\n</div>\n<p data-mce-fragment=\"1\">Family Name: Araceae</p>\n<p data-mce-fragment=\"1\">Endemic To: Borneo</p>\n<p data-mce-fragment=\"1\">pH: 6-7</p>\n<p data-mce-fragment=\"1\">Care: Easy</p>\n<p data-mce-fragment=\"1\">Light: Low to Medium</p>\n<p data-mce-fragment=\"1\">Co2: Not necessary but recommended </p>\n<p data-mce-fragment=\"1\">Propagation: Cut by rhizome</p>\n<p data-mce-fragment=\"1\">Growth rate: Moderate</p>",
