    "description": "<p><meta charset=\"UTF-8\"><span data-mce-fragment=\"1\">Echinodorus Iguazu 09 is arguably the rarest and most beautiful sword in this hobby; yet, it is easy to grow and does not require much effort and time to care. </span></p>\n<p><span data-mce-fragment=\"1\">Echinodorus Iguazu 09 grows slowly, suitable for planted or shrimp tanks. As the plant grows, it absorbs large amounts of nitrate in the tank, helping to keep the water environment safe and healthy for shrimps and fishes. It is also known to have pretty high resistance to algae. </span></p>\n<p><span data-mce-fragment=\"1\">*Buyer can feel free to reach me for the plant care and guides. </span></p>\n<p><span data-mce-fragment=\"1\">Difficulty Level: Very Easy (known to be hardier than Anubias) </span></p>\n<p><span data-mce-fragment=\"1\">Plant position: Foreground to Midground Growth rate: Very Slow (Estimate 10 day grows 1 leaf) </span></p>\n<p><span data-mce-fragment=\"1\">Size: cutting with around 2-3 leaves. Please contact us if you want larger cuttings.</span></p>\n<p><span data-mce-fragment=\"1\">CO2: Not required (with CO2 can help boost growth) </span></p>\n<p><span data-mce-fragment=\"1\">Light: Low - High Temperature: 15 - 32 °C </span></p>\n<p><span data-mce-fragment=\"1\">Origin: Iguazu Falls (in the continent of South America, on the border of the Argentina province of Misiones and the Brazilian state of Parana.)</span></p>",
