    "images": [
      "https://cdn.shopify.com/s/files/1/0587/7422/5058/products/Bolbitis-heudelotii.jpg?v=1631002447",
      "https://cdn.shopify.com/s/files/1/0587/7422/5058/products/Bolbitis-Heudelotii-Caresheet-African-water-fern-for-sale-and-where-to-buy-AquaticMag-6.jpg?v=1631002447"
    ],
    "description": "<meta charset=\"UTF-8\">\n<p data-mce-fragment=\"1\">Bolbitis heudelotii<em data-mce-fragment=\"1\"></em><strong data-mce-fragment=\"1\"><em data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"> </span></em></strong>is a wonderful aquatic plant among the aquarium enthusiasts. It is also referred to as African water fern, African fern, Bolbitis, Bolbitis water fern, Creeping fern or Congo fern. It is distributed in the tropical regions of Africa. It has become more popular in the aquarium hobby due to its uniquely textured foliage and growth form. In the wild it is found as an epiphyte in fast flowing streams, lakes or rivers over sandy or rocky bottoms.</p>\n<p data-mce-fragment=\"1\">Bolbitis heudelotii<span data-mce-fragment=\"1\"> or African water fern is a popular aquatic plant. It can grow with low to high light under fully submersed condition. It is often used as a mid-ground specimen plant in tropical freshwater aquarium. It has dark green, semi-translucent with attractive and decorative shape pinnate leaves with 15–40 cm long and 15–25 cm broad. The transparent and dark green leaves make this plant a beautiful addition to almost any aquarium layout.  The leaves are arranged alternately towards each other. This plant has a widely creeping rhizome up to 10 mm in diameter which produces leaves and roots. Rhizome scales are very dark brown in color and lanceolate in shape.</span> </p>\n<p data-mce-fragment=\"1\"> </p>\n<h3 class=\"p2\"><b>Care Guidelines:</b></h3>\n<ul class=\"ul1\">\n<li class=\"li2\">\n<span class=\"s1\"></span>Temperature: 20 -<span class=\"Apple-converted-space\"> <span> </span></span>28</li>\n<li class=\"li2\">\n<span class=\"s1\"></span>pH: 5.0 - 7.0</li>\n<li class=\"li2\">\n<span class=\"s1\"></span>Lighting: Medium</li>\n<li class=\"li2\">\n<span class=\"s1\"></span>Aquarium Placement: Rock and Driftwood</li>\n<li class=\"li2\">\n<span class=\"s1\"></span>Care: Easy</li>\n<li class=\"li2\">\n<span class=\"s1\"></span>Suitable for Beginner: Yes</li>\n</ul>\n<p> </p>\n<h3 class=\"p2\"><b>Product details</b></h3>\n<p class=\"p3\"><strong>Each portion</strong><span>: 1 rhizome ( 3-5 leaves ) </span></p>",
